Service Cloud Alternative Sites Setup Pathway

To set up Service Catalog Guest Users in sites alternative to Experience Cloud, such as Salesforce Sites and externally built sites, take these steps.

Required Editions and User Permissions
Available in: Lightning Experience
Enterprise, Performance, and Unlimited Editions with Customer Service Catalog add-on license.
Customize Application perm set AND Service Catalog Builder perm set

This article applies to: External and Salesforce Sites
Aura and LWR Experience Sites

A Visualforce page that grants guest users access to your Service Catalog in your alternative site
A Salesforce Site that exposes your catalog items to guest users in your alternative site

Step I: Create a Visualforce Page
Required Editions: External and Salesforce sites
From Setup, create a new Visualforce Page.
Enter the code:
<apex:page showHeader="false" sidebar="false">
  <apex:includeLightning />
  <div id="item" />
    <script>
        $Lightning.use("runtime_service_servicecatalog:serviceCatalogLightningOut", function() {
          $Lightning.createComponent("runtime_service_servicecatalog:catalogItem",
              {itemApiName: 'item_1708593530216_ItemFlow1'},
              "item",
              function(cmp) {
                console.log("Item runner created");
                // do some stuff
              }
          );
        });
    </script>
</apex:page>

Optional: To add support of authenticated users in your alternative site for Service Catalog, complete steps 1 through 5 and enter this code:
<html>
  <script src="SiteURL/lightning/lightning.out.js"></script>
  <body>
    <h1>Header</h1>
    <div id="item"></div>
  </body>
  <script>
    // What needs to be done as well: in your org, add this URL (probably localhost) to CORS
    var token = "<token, not prefixed by Bearer>"
    $Lightning.use("runtime_service_servicecatalog:serviceCatalogLightningOut", function() {
             $Lightning.createComponent("runtime_service_servicecatalog:catalogItem",
            { itemApiName: "<itemName>", targetCustomerId: “<CustomerId>” },
            "item",
            function(newCmp, status, errorMessage) {
                if (status === "SUCCESS") {
                    console.log("Component Created Successfully");
                } else {
                    console.log("Component not created | " + errorMessage);
                }
            }
        );
    },"SiteURL"
    ,token);
  </script>
</html>

Save your work.
From the Sites Setup page, select the name of your site and grant guest users access to catalog items.

Step II: Create a Salesforce Site
Required Editions: External and Salesforce Sites
From Setup, create a new Site.
Select Public Access Settings.
Add your autolaunched and orchestration flows to Enabled Flows.

Save your work.
